sourcesContent:
import {getConnection} from "./../database/database";

const getcarta= async (req,res) =>{
    try{
    const connection = await getConnection();
    const result = await connection.query("SELECT id_carta, producto, tipo, volumen, valor, cantidad FROM carta");
    res.json(result);
    }catch(error){
        res.status(500);
        res.send(error.message);
    }
};

export const methods = {
    getcarta
};

